  'Umbriel',
];

const Home = () => (
  <div>
    <img src={logo} className="rogo" width="120px" alt="logo" />
    {/* <h1>牛とともに生きる。</h1>
    <h1>食べることは、</h1>
    <h1>生きること。</h1> */}
  </div>
);


